column28:
Apăsând pe butonul drept al mouse-ului/șoarecelui de pe suprafața pe care este așezat, click-ul fiind poziționat pe o zonă liberă a videoclipului, apar mai multe opțiuni oferite de către platforma YouTube:

* Account;
* Loop;
* Copy video URL;
* Copy video URL at current time;
* Copy embed code;
* Copy debug info;
* Troubleshoot playback issue;
* Stats for nerds.

În consola site-ului web este prezentă eroarea: 

jquery.min.js:19 

{noformat}   POST <https://www.primariatechirghiol.ro/wp-content/themes/portal/petitie_persoana_fizica.php> 404 (Not Found){noformat}

